Accounts_CustomFields_Description:
Debe ser un JSON válido, donde las claves son los nombres de los campos que contienen un diccionario de configuración de campos. Example:<br/><code>{
 "role": {
  "type": "select",
  "defaultValue": "student",
  "options": ["teacher", "student"],
  "required": true,
  "modifyRecordField": {
   "array": true,
   "field": "roles"
  }
 },
 "twitter": {
  "type": "text",
  "required": true,
  "minLength": 2,
  "maxLength": 10
 }
}</code>

Custom_Translations_Description:
Debe ser un JSON válido donde las claves sean idiomas que contengan un diccionario de clave y traducciones. Ejemplo: <br/><code>{
 "en": {
  "Channels": "Rooms"
 },
"pt": {
  "Channels": "Salas"
 }
}</code>

SAML_Custom_user_data_fieldmap_descripti:
Configurar cómo se rellenan los campos de la cuenta de usuario (como el correo electrónico) a partir de un registro en SAML (una vez encontrado) 
Por ejemplo, `{"name":"cn", "email":"mail"}` elegirá el nombre legible de una persona del atributo cn, y su correo electrónico del atributo mail.
Campos disponibles en Rocket.Chat:  `name`, `email` and `username`, todo lo demás se guardará como `customFields`.
Asigne el nombre de un atributo inmutable a la clave '__identifier__' para usarlo como identificador de usuario.
También puedes usar regexes y plantillas. Las plantillas se procesarán primero, excepto cuando hagan referencia al resultado de la regex.
```{
  "email": "mail",
  "username": {
    "fieldName": "mail",
    "regex": "(.*)@.+$",
    "template": "user-__regex__"
  },
  "name": {
   "fieldNames": [
      "firstName",
      "lastName"
    ],
    "template": "__firstName__ __lastName__"
  },
  "__identifier__": "uid"
}```
